import React from 'react';
import CategoryWiseProductDisplay from '../component/CategoryWiseProductDisplay';

function MensWearPage() {
  return (
    <CategoryWiseProductDisplay
      category="Watches"
      heading="Popular's Watches"
    />
  );
}

export default MensWearPage;
